import propTypes from "prop-types";
import "./Card.css";

const Card = ({ number1, number2 }) => {
   return <div className="Card">{number1 + number2}</div>;
};

Card.propTypes = {
   number1: propTypes.number,
   number2: propTypes.number,
};

export default Card;
